INSERT IGNORE INTO `#__virtuemart_products_XLANG` (`virtuemart_product_id`, `product_s_desc`, `product_desc`, `product_name`, `metadesc`, `metakey`, `customtitle`, `slug`) VALUES
(1, 'GHD\r\nCEG\r\nFAC', '<p>Default product with standart settings no customfields. You can set:</p>\r\n<p>Tab Product Information<br />- General: Published, On Featured, Product SKU, Product Name, Produkt alias, URL, <br />- Assignation:Manufacturer, Product Categories, Shopper Groups, Type of Product detail page<br />- Product pricing: Cost price, Base price, Final price, Override, and priceranges dependant on Shopper group.<br />- You can add Child products here also.</p>\r\n<p>Tab Product Description<br />- Description, Short description, Meta information</p>\r\n<p>Tab Product Status<br />- Stock amount, Low Stock notification, Minimum and maximum purchase quantity, Availability Date + image<br />- Booked, ordered products amount, Quantity Steps<br />- Also it is possible to send email to shopper who bought this product.</p>\r\n<p>Tab Dimension and Weight<br />- Lenght, Width, Height, Weight, Packing, and Units in Box</p>\r\n<p>Tab Product images<br />- Use already uploaded images<br />- Set image information<br />- Upload new image<br />- manage thumbnail</p>\r\n<p>Tab Custom Fields<br />- Set related Categories &amp; Products<br />- Select customfields</p>\r\n<p> </p>\r\n<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua.</p>\r\n<p>At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.</p>\r\n<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.   <br /><br /></p>', 'Default product', '', '', '', 'default-product'),
	(2, 'It\'s a free Product!', '<p>This product shows how a free product is set up. The shopper can purchase without beeing charged. In all cases the shopper needs to checkout.</p>\r\n<p>It can be used e.g. if you want to offer catalogues or sample products.</p>', 'Free product', '', '', '', 'free-product'),
	(3, 'Default product with customfield string & text & editor', '<p>This is a default product with standart settings and:</p>\r\n<p>Customfield type string(<strong>This is the content of the customfield string.</strong>),<br />Customfield type string list in backend(<strong>Content 1,2, or 3</strong>)  <br />Customfield type text area (<strong>Some text in textarea. </strong><strong>Lorem Ipsum...</strong>)</p>', 'Customfield string, text, editor', '', '', '', 'product-w-customfield-string'),
	(5, 'This is a default product with standart settings and a customfield type parent.', '<p>Customfield boolean &amp; group:<br /><br />You can set use customfield type parent to bind multiple child customfields into a group.<br /><br />For example for books, you may wish to always give the following description:</p>\r\n<p>Reading level: Ages 18-99<br />Hardcover: 224 pages<br />Publisher: Amulet Books<br />Language: English<br /><br />Therefore bind multiple customfields e.g. string into a parent customfield to use it as a pattern.</p>', 'Boolean &#38; grouped customfields', '', '', '', 'product-grouped-customfields'),
	(15, 'Default product generic child variant and cart variant.', '<p>This product is a showcase to present the combination of product price, child variant price, and cart variant price.<br /><br />Cart variant -&gt; easy to use, add price (+0.50€) no variant stock control</p>\r\n<p><br />Child variant -&gt; full overrideable genuine product as variant</p>', 'Generic child &#38; cart variant', '', '', '', 'product-generic-child-variant-cart-variant'),
	(16, '', '', 'generic child variant A', '', '', '', 'child-variant-w-cart-variant-1'),
	(17, '', '', 'generic child variant B', '', '', '', 'child-variant-w-cart-variant-2'),
	(18, '', '', 'generic child variant C', '', '', '', 'child-variant-w-cart-variant-3'),
	(19, 'Showcase for pattern usage.', '<p>This product is used as a pattern for other products. It is a parent product and has multiple child products. <br />You can set several settings (content, customfields) for parent product. Childs of this parent will basically have the same settings as the parent automatically inherit except you overwrite the settings.<br /><br /></p>\r\n<p>In this case product price is set in pattern.</p>', 'Basic PATTERN', '', '', '', 'basic-pattern'),
	(20, 'This is a basic child of Product PATTERN.', '<p>This is a basic child of Product PATTERN. You see inherited settings, only Product description is overwritten.<br /><span style="background-color: #FCDB73; text-align: center;padding: 5px 40px;">Basically Manufacturer and Category are not inherited, for showcase reason both are set in this case.</span></p>', 'Basic child', '', '', '', 'basic-pattern197'),
	(21, 'This is a basic child of Product PATTERN. You see inherited settings.', '<p>This is a basic child of Product PATTERN. You see inherited settings. <br />Overwritten are following setting/content:<br />- Product desc<br />- Product price<br /><span style="background-color: #FCDB73; text-align: center;padding: 5px 40px;">Basically Manufacturer and Category are not inherited, for showcase reason both are set in this case.</span></p>', 'Basic price overwrite', '', '', '', 'basic-price-overwrite'),
	(22, 'Multiple overwrites short desc.', '<p>This is a child of Product PATTERN. Most inherited settings are overwritten: <br />- Short desc<br />- Product desc<br />- Product price<br />- Product Images<br />- Product Dimension and Weight (Units in Box)<br /><span style="background-color: #FCDB73; text-align: center;padding: 5px 40px;"><br />Manufacturer and Category are not inherited.</span></p>', 'Basic multiple overwrites', '', '', '', 'basic-multiple-overwrites'),
	(23, 'Showcase advanced pattern usage.', '<p>This product is used as a pattern for other products. It is a parent product and has multiple child products. <br />You can set several settings (content, customfields) for parent product. Childs of this parent will basically have the same settings as the parent automatically inherite until you overwrite.</p>\r\n<p>One of the hugest advantages is stock control ability.</p>\r\n<p> </p>', 'Advanced PATTERN', '', '', '', 'advanced-pattern'),
	(24, '', '<p>This is a basic child of Product PATTERN. You see inherited settings, only Product description is overwritten.<br /><span style="background-color: #FCDB73; text-align: center;padding: 5px 40px;">Basically Manufacturer and Category are not inherited, for showcase reason both are set in this case.</span></p>', 'Advanced child', '', '', '', 'advanced-child'),
	(25, '', '<p>This is a advanced child of Advanced PATTERN. You see inherited settings. <br />Overwritten are following setting/content:<br />- Product desc<br />- Product price<br /><span style="background-color: #FCDB73; text-align: center;padding: 5px 40px;">Basically Manufacturer and Category are not inherited, for showcase reason both are set in this case.</span></p>', 'Advanced price overwrite', '', '', '', 'advanced-price-overwrite'),
	(26, 'Advanced multiple overrides', '<p>This is a child of Product PATTERN. Most inherited settings are overwritten: <br />- Short desc<br />- Product desc<br />- Product price<br />- Product Images<br />- Product Dimension and Weight (Units in Box)<br />- Customfields<br /><span style="background-color: #FCDB73; text-align: center;padding: 5px 40px;"><br />Manufacturer and Category are not inherited</span></p>', 'Advanced multiple overrides', '', '', '', 'advanced-multiple-overrides'),
